import { Component, OnInit } from '@angular/core';
import { SudokuGeneratorService } from './service/sudoku-generator.service';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss'],
})
export class AppComponent implements OnInit {
  sudokugrid: any;
  constructor(private sudokuGeneratorService: SudokuGeneratorService) {}
  ngOnInit() {
    this.sudokugrid = this.sudokuGeneratorService.generateSudoku();
  }
  generatenewSudoku() {
    this.sudokugrid = this.sudokuGeneratorService.generateSudoku();
  }
  printOutput(result: Any) {
    alert(result);
  }
}
<app-sudoku-grid [grid]="sudokugrid"></app-sudoku-grid>
<button (click)="generatenewSudoku()">Generate New Suduku</button>
